import React, { Component, Fragment } from 'react'
import Head from 'next/head'
import styled from 'styled-components'
import Center from '../utils/center'
import Layout from './components/layout'
import Slider from 'react-slick';

import FmLogo from '../assets/findME/fnme.png';
import Frag1 from '../assets/findME/frag_1.webp';
import Frag2 from '../assets/findME/frag_2.webp';
import Frag3 from '../assets/findME/frag_3.webp';


export default class Products extends Component {



    render() {
        return (
            <Layout>

                <Head>
                    <title>Products</title>
                    <link rel="icon" href="/h.png" />
                </Head>

                <Center>
                    <FindMeWrapper>
                        <FindMeLogo src={FmLogo} alt='FindMe Logo' />
                      
                        <SliderContainer>

                            <Slider
                                dots={true}
                                infinite={true}
                                speed={500}
                                slidesToShow={1}
                                slidesToScroll={1}
                            >
                                {/* <ImagesContainer>
                                    <SliderFragment src={Frag1} alt='abductions lost missing' />
                                </ImagesContainer>
                                <ImagesContainer>
                                    <SliderFragment src={Frag2} alt='abductions lost missing' />
                                </ImagesContainer>
                                <ImagesContainer>
                                    <SliderFragment src={Frag3} alt='abductions lost missing' />
                                </ImagesContainer> */}
                            </Slider>
                     
                        </SliderContainer>
                    
                    </FindMeWrapper>
                </Center>
            </Layout >
        )
    }
}

const FindMeWrapper = styled.div`
    display: flex;
    width: 100%;
    height: 800px;
    background-color: grey;
    justify-content: center;
    align-items: center;
`

const FindMeLogo = styled.img`
    width: 128px;
`

const SliderContainer = styled.div`
    height: 80%;
    width: 80%;
    background-color: lightgoldenrodyellow;
    align-items: center;
`

const ImagesContainer = styled.div`
    width: 300px;
    height: 300px;
    background-color: blueviolet;
`

const SliderFragment = styled.img`
    width: 300px;
    height: 300px;
    padding: 16px;
    object-fit: contain;
    
    
`
